('1385', 'SURFACE USE EXPLOSIVE ORDNANCE DISPOSAL TOOLS AND EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Surface Use Explosive Ordnance Disposal Tools and Equipment', 'Nonspecialized or common tools and equipment not developed exclusively for use by qualified EOD personnel; specialized demolition material; explosive loaded shaped charges.', 'This class includes only specialized tools and equipment developed for and used by qualified Explosive Ordnance Disposal (EOD) personnel.', 'Nonspecialized or common tools and equipment not developed exclusively for use by qualified EOD personnel; specialized demolition material; explosive loaded shaped charges.'),
('1386', 'UNDERWATER USE EXPLOSIVE ORDNANCE DISPOSAL AND SWIMMER WEAPONS SYSTEMS TOOLS AND EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Underwater Use Explosive Ordnance disposal and Swimmer Weapons Systems Tools and Equipment.', NULL, 'This class includes only specialized tools and equipment developed for and used by qualified Explosive Ordnance Disposal (EOD) personnel, Underwater Demolition Teams (UDT), and/or Sea-Air-Land (SEAL) personnel.  Excludes Nonspecialized or common tools not developed exclusively for use by qualified EOD, UDT, and/or SEAL personnel; specialized demolition material; explosive loaded shaped charges.', NULL),
('1390', 'FUZES AND PRIMERS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fuzes and Primers', 'Fuzes and Primers for ammunition not classified in classes 1310, 1315, and 1320.', 'This class includes only fuzes and primers for use in ammunition classified in classes 1310, 1315, and 1320.', 'Fuzes and Primers for ammunition not classified in classes 1310, 1315, and 1320.'),
('1395', 'MISCELLANEOUS AMMUNITION', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Miscellaneous Ammunition', NULL, NULL, 'Ammunition Shapes, such as Blanks, Disks, Slugs, Cups, and Rotating Bands (Shell Bands).'),
('1398', 'AMMUNITION HANDLING & SERVICING EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Specialized Ammunition Handling and Servicing Equipment.', 'Handling and servicing equipment specially designed for use on or with rocket and pyrotechnic launchers; Ammunition maintenance and repair shop specialized equipment; Handling equipment specially designed for aircraft or airfield use.', NULL, 'Handling and servicing equipment specially designed for use on or with rockets and conventional ammunition.'),
('14', 'GUIDED MISSLES', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group includes missiles (with or without warheads or explosive components) incorporating mechanisms capable of altering normal flight paths.  Radar and infrared assemblies and components designed specifically for use with guided missiles are classified in the appropriate classes of this group.  Excluded from this group are case sections, nose cones, flare sections, center sections, warheads, explosive components, rockets, and auxiliary components of missiles and re-entry vehicles which are designed or constructed for  exclusive use with or for housing of nuclear warheads and/or warhead sections.  Also excluded are space vehicle nose cones and space capsules specifically designed to carry loads peculiar to space research and space travel', NULL),
('1410', 'GUIDED MISSILES', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Guided Missiles', NULL, 'This class includes only complete guided missiles,  with or without warheads and explosive components, whether in assembled or unassembled form.  End items, assemblies, parts, attachments, or accessories for use in or on guided missiles are classified in classes other than this class.', 'Complete Drones, initially designed as missiles, but converted to drone use.'),
('1420', 'GUIDED MISSILE COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Guided Missile Components', 'Electronic Remote Guidance Equipment used to guide missiles; Solid and Liquid Propellant Units; Components of Gyro Mechanisms.', NULL, 'Structural Components; Components and Accessories Specially Designed for use on or with guided missiles, including Complete Gyro Mechanisms, Hydraulic Pumps, Automatic Pilot Mechanisms and Specially Designed Assemblies, and Electronic  Guidance Equipment installed in missiles.'),
('1425', 'GUIDED MISSILE SYSTEMS, COMPLETE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Guided Missile Systems, Complete', 'Guided Missile Subsystems.', 'This class includes only complete guided missile systems.  Anything less than a complete system, such as individual end items, assemblies, parts, attachments, or accessories for use in guided missile systems are classified in classes other than this class.', 'Guided Missile Subsystems.'),
('1427', 'GUIDED MISSILE SUBSYSTEMS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Guided Missile Subsystems', 'Complete Guided Missile Systems.', 'This class includes only combinations or assemblies of two or more end items, each of which is properly classified in other classes of this group, identified as single items of supply. Excluded from this class are individual end items, assemblies, subassemblies, attachments, accessories or parts classified in other classes of this group, not combined as single items of supply.', 'Complete Guided Missile Systems.'),
('1430', 'GUIDED MISSILE REMOTE CONTROL SYSTEMS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guided Missile Remote Control Systems', 'Guided Missile Internal (Built-in) Control Systems; Components used in both guided missiles and other than guided missiles (including fire control components).', 'This class includes airborne and nonairborne guided missile remote control systems, components, and accessories, designed specifically for use therewith. Excluded from this class are fire control assemblies, subassemblies, and components modified for use with guided missile remote control systems, and fire control assemblies designed specifically for shipboard use.', 'Specially Designed Components of Guided Missile Remote Control Systems.'),
('1440', 'LAUNCHERS, GUIDED MISSILE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Launchers, Guided Missile', 'Aircraft Launchers; Rocket Launchers.', NULL, 'Airborne and Nonairborne Guided Missile Launchers.'),
