('1550', 'DRONES', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Drones', 'Piloted aircraft and guided missiles converted to drone use.', 'This class includes only complete drones. End items, assemblies, parts, attachments, or accessories for use in or on drones are classified in classes other than this class.', 'Drones specifically designed for such uses as targets, training, surveillance, missile evaluation, and photographic  reconnaissance.'),
