('1560', 'AIRFRAME STRUCTURAL COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Airframe Structural Components', 'Fitted Covers; Helicopter Rotor Brake System and Components; Aircraft Loose Equipment and Alternate Mission Configuration Equipment stored on board the Aircraft.', 'This class includes fabricated system parts that are permanently attached or peculiar to the integral airframe of an aircraft, such as support structural components, spars, ribs, ailerons, stablizers, bulkheads.', 'Flight Control Surfaces, internal and external Auxiliary Fuel Tanks; Exhaust Systems, Pylons, Trim Tabs; Aircraft.'),
