('1615', 'HELICOPTER ROTOR BLADES, DRIVE MECHANISMS AND COMPONENTS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Helicopter Rotor Blades, Drive Mechanisms and Components', 'Propellers (FSC 1610), Rotor Brake Systems Components (FSC 1630), Rotor Blade Hydraulic Folding System Components (FSC 1650), Hydraulic Servo System Components (FSC 1650).', 'This class includes miscellaneous component parts specifically designed for, and used exclusively in, helicopter drive mechanisms and rotor blades when not specifically classified elsewhere in the FSC indexes.', 'Helicopter dynamic components and specially designed parts that transmit power from the aircraft power  plant to the rotary wing and rotary rudder.  Also included in this class are Rotors; Blades; Rotor Blade, Trim, Tabs; Blade Sets; Yokes; Clutches and Transmissions.'),
('1620', 'AIRCRAFT LANDING GEAR COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Aircraft Landing Gear Components', 'Mounting Braces and Mounting Plates permanently installed on aircraft (FSC 1680), Landing Wheels, Skis, and Floats (FSC 1630), Wheel Brakes and Wheel Brake Cylinders (FSC 1630).', NULL, 'Shock Struts and Components; Installation Elements, such as Torsion Bars, Vibration Links, Drag Struts; Landing Gear Trunions, Axles and Shimmy Dampeners; Specially designed hydraulic power steering system components.'),
