('1680', 'MISCELLANEOUS AIRCRAFT ACCESSORIES AND COMPONENTS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Miscellaneous Aircraft Accessories and Components', 'Engine Mounted Control Assemblies; Fitted Covers, Aircraft Pylons; Helicopter Rotor Brake  System Components; Helicopter Automatic Stabilization  Equipment.', NULL, 'Control Assemblies, Push-Pull; Brace, Positioning Cargo Ramp Stowed on Board; Cockpit Mounted Control Quadrants; Actuators, Electromechanical and Mechanical; Ventilators; Relief Tubes; Map Holders; Aerial Glider Towing Accessories Attached to Aircraft; Belts, Safety and Lap; Harness, Shoulder and Safety; Litter Attaching Supports; Electric Windshield Wipers; Aircraft Onboard Inert Gas Generators; Aircraft Furniture; Aircraft Mounted Winches and Hoists; In-Flight Refueling System Components, including Fuel Components; Aircraft Curtains; Cable Tension Regulators;  Sun Visors; Rear-View Mirrors; Mechanical  Transmissions, Gearboxes and Constant Speed Drives Specially Designed for Aircraft.'),
