('2320', 'TRUCKS AND TRUCK TRACTORS, WHEELED', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Trucks and Truck Tractors, Wheeled', 'Fire Trucks; Special Construction Type Earth and Rock Hauling Trucks; Motorized Air Compressors; Motorized Concrete  Mixers; Construction Specialized Machinery Generally;  Specially designed trucks for use in and around, airfields, hangars, and warehouses; Tracked and Halftracked Vehicles.', 'This class includes only complete wheel mounted  trucks and truck tractors, and chassis therefore.   Any end items, assemblies, parts, attachments, or accessories other than complete chassis, for use in or on such trucks or  truck tractors are classified in classes other than this  class.  The combined chassis and body of a special purpose  truck, such as a machine shop, mobile laundry, or dental  laboratory, is classified in this class.  The complete mobile  unit, consisting of chassis, body, and additional equipment, as in an equipped truck mounted machine shop, is excluded from this class.', 'Panel, Delivery and Pick Up Trucks, Tactical and  Administrative Military Cargo Carrying Vehicles, including  Wheel Mounted Amphibian Vehicles; Truck Tractor and Trailer  Combinations; Armored Cars.'),
('2330', 'TRAILERS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Trailers', 'Fire Fighting Trailers; Specially designed trailers for use in and around airfields, hangars, and warehouses.', 'This class includes only complete trailers, and  chassis therefor.  Any end items, assemblies, parts,  attachments, or accessories, other than complete chassis, for use in or on trailers are classified in classes other  than this class.  The combined chassis and body of a special purpose trailer, such as a machine shop, mobile laundry, or dental laboratory, is classified in this class. The complete mobile unit, consisting of chassis, body, and additional equipment, as in an equipped trailer-mounted machine shop,  is excluded from this class.', 'Semitrailers; Semitrailer Dollies; Cargo Trailers; Passenger and House Trailers; Special Purpose Trailers,  such as Ammunition.'),
('2340', 'MOTORCYCLES, MOTOR SCOOTERS, AND BICYCLES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Motorcycles, Motor Scooters, and Bicycles', 'Children''s Wheeled Goods.', 'This class includes only complete motorcycles,  complete motor scooters, and complete bicycles.  End items,  assemblies, parts, attachments, or accessories for use in or  on motorcycles, motor scooters, or bicycles are classified  in classes other than this class.', 'Sidecars; Tricycles.'),
('2350', 'COMBAT, ASSAULT, AND TACTICAL VEHICLES, TRACKED', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Combat, Assault, and Tactical Vehicles, Tracked', 'Wheel Mounted Vehicles', 'This class includes only complete combat, assault, and tactical tracked vehicles, and chassis therefor.  Any end items, assemblies, parts, attachments, or accessories, other than complete chassis, for use in or on such vehicles are classified in classes other than this class.', 'Tanks and Tracked Self-Propelled Weapons and  Vehicles with or without amphibian capabilities; Armored  Halftracks; Self-Propelled Sleds; and Self-Propelled Flame  Throwers.'),
('2355', 'COMBAT ASSAULT AND TACTICAL VEHICLES WHEELED', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Combat, Assault, and Tactical Vehicles, Wheeled', 'Track Mounted Vehicles not specifically designed for combat, assault, textical situations; Passenger Motor Vehicles (FSC 2310)', 'This class includes only complete combat, assault, and tactical wheeled vehicles and chassis.  Any end items, assemblies, parts, attachments, or accessories, other than complete chasis, for use in or on such vehilces are classified in classes other than this class.', 'Wheeled Self-Propelled Weapons and combat vehicles with or without amphibian capabilities; Armored Wheeled Vehicles; Self-Propelled Wheeled Sleds; and Self-Propelled Wheeled Flame Throwers.'),
('24', 'TRACTORS', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group includes only complete tractors and tractor chassis.  Assemblies, subassemblies, parts, attachments or accessories are excluded from this group.', NULL),
('2410', 'TRACTOR, FULL TRACKED, LOW SPEED', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Tractors, Full Tracked, Low Speed', 'High Speed Tractors (FSC Class 2430 Armored  Dozer-Scraper Combination Tractors (FSC Class 2350).', 'This class includes only complete low speed, full track tractors, and chassis therefor.  Any end items,  assemblies, parts, attachments, or accessories, other than complete chassis, for use in or on low speed, full track  tractors are classified in classes other than this class.', 'High Speed Tractors (FSC Class 2430 Armored  Dozer-Scraper Combination Tractors (FSC Class 2350).'),
('2420', 'TRACTORS, WHEELED', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Tractors, Wheeled', 'Aircraft Towing Tractors and Crashed Aircraft Moving Tractors (FSC Class 1740), Aircraft Towing-Power Servicing Tractors (FSC Class 1730), Warehouse Tractors (FSC Class 3930).', 'This class includes only complete wheeled tractors, and chassis therefor.  Any end items, assemblies, parts, attachments, or accessories, other than complete chassis, for use in or on wheeled tractors, are classified in classes other than this class.', 'Agricultural Tractors; High Speed Tractors; Industrial Tractors.'),
('2430', 'TRACTORS, FULL TRACKED, HIGH SPEED', to_date('11/15/1978', 'MM/DD/YYYY'), NULL, 'Tractors, Full Tracked, High Speed', 'Low Speed Tractors (FSC Class 2410), Armored Dozer-Scraper Combination Tractors (FSC Class 2350).', 'This class includes only complete high speed track laying tractors, and chassis therefor.  Any end items. assemblies, parts, attachments, or accessories, other than complete chassis, for use in or on high speed track laying tractors, are classified in classes other than this class.', 'Low Speed Tractors (FSC Class 2410), Armored Dozer-Scraper Combination Tractors (FSC Class 2350).'),
('25', 'VEHICULAR EQUIPMENT COMPONENTS', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'The term "vehicular", as delimited for group 25, is applicable to those vehicles.  And tractors included in groups 23 and 24, construction vehicles included in group 38, and warehouse trucks, tractors, and trailers included in group 39.  It does not apply to railway vehicles (group 22), aircraft (group 15), or watercraft (group 19).  An item of supply which is a "vehicular" component, within the scope delimited above, is classified in this group, regardless of whether it has additional applications on vehicles outside the delimitations for this group.', NULL),
