('3693', 'INDUSTRIAL ASSEMBLY MACHINES', to_date('05/15/1979', 'MM/DD/YYYY'), NULL, 'Industrial Assembly Machines', 'Specialized Ammunition and Ordnance Assembly  Machines; Wrapping and Packaging Machinery; Metalworking Machinery; Hand Tools.', 'This class includes equipment specifically  designed to assemble pre-fabricated components without further design machining of the components. Equipment  designed to perform combined machining and assembling  operations which result in material removal are classified in classes other than this class. Also excluded are items for which more specific classifications are suitable', 'Industrial Production Type Power Screwdriving  Machines; Circuit Card Assembly Machines.'),
