('3915', 'MATERIALS FEEDERS', to_date('02/15/1979', 'MM/DD/YYYY'), NULL, 'Materials Feeders', 'Aggregate and Fines Feeders; Conveyor Feeders; Water Purification Dry Chemical Feeders.', 'Materials handling equipment included in this  class is restricted to those materials feeders and parts feeders that serve as a conveying device, and by which the rate of delivery of bulk materials, packages, or objects may be controlled.  Items included in this class  are synchronized with companion machinery, feeding  predetermined amounts, by volume, of specific materials accurately and continuously from storage bins or hoppers to process or mixing machines, and are interchangeable  between machines. Excluded from this class are conveyor feeders (i.e., apron, belt, chain, flight, pan, etc., adapted for feeder service) that are classifiable in  Class 3910 and/or Class 3895, as appropriate.', 'Dry Materials Feeders; Parts Feeders.'),
('3920', 'MAT HANDLING EQ - NONSELF-PROPELLED', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Materials Handling Equipment, Nonself- Propelled', 'Conveyors.', NULL, 'Dolly Trucks; Pushcarts; Handcarts; Wheelbarrows; Hand Trucks; Materials Handling Trailers.'),
