('4010', 'CHAIN AND WIRE ROPE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Chain and Wire Rope', 'Power Transmission Chain (FSC 3020), Slings.', 'Chain and wire rope, with attachments or terminations will be classified in this class when they are for general use.  a.  Chain is a series of flexible links and/or rings fitted into one another used for supporting, lifting, restraining, dragging, or transmitting power.  b.  Wire rope is formed from strands of twisted wire.', 'Bead Chain; Weldless Chain; Single Leg Chain Assemblies; Wire Rope; Wire Cord; Single Leg Wire Assemblies.'),
('4020', 'FIBER ROPE, CORDAGE, AND TWINE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fiber Rope, Cordage, and Twine', 'Wire Rope (FSC 4010), Slings (FSC 3940).', 'Fiber rope is classified in this class when it is bulk material or for general use.  Items with attachments and/or terminations are identified in this class unless a more specific item name is used.  a.  Fiber rope is flexible twisted strands of manila, nylon or other fiber.  b. Cordage is ropes or cords used in rigging (see item name definitions for parameters).  c.  Twine is two or more strands twisted together.', 'Fibrous Cord Assemblies; Fibrous Cord; Fibrous Rope; Fibrous Twine.'),
('4030', 'FITTINGS FOR ROPE, CABLE, AND CHAIN', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fittings for Rope, Cable, and Chain', 'Clamp Blocks (FSC 5340), Support Hooks (FSC 5340).', 'All items, including specially designed, will be classified in this FSC.  Fittings classified in this FSC are items used in conjunction with chain, rope, and are attached to perform certain functions, (e.g., hooks, shackles, and wedges) refer to item name definitions for parameters.', 'Anchor Guys; Wire Stranded Bands; Wire Rope Clamps; Cargo Hooks; Shackles; Swivels; Rope Terminals; Rope Wedges.'),
('41', 'REFRIG, AIR CONDIT/CIRCULAT EQPT', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, NULL, NULL),
('4110', 'REFRIGERATION EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Refrigeration Equipment', 'Cafeteria Type Refrigerated Display Cases; Soda  Fountains; Milk, Soda, and/or Ice Cream Dispensers; Cold  Food Counters; Carbonators; Combination Heated-Refrigerated  Food Serving Equipment; Cafeteria Type Showcases; Chilling Equipment used for display and serving of food (see class  7310 for these items).  Also excluded from this class are refrigeration components (see class 4130).', 'This class includes only complete refrigeration equipment, whether refrigerated from an integral or remote mechanical refrigeration unit or system.  Also included in  this class are refrigeration plants, and complete "packaged"  refrigeration units and systems containing a power driven  compressor, condenser, evaporator, and all other necessary  components to refrigerate an enclosed space.  Nonoperating  accessories such as ice trays, shelves, and panels are included in this class.  Excluded from this class are  operating components, assemblies, parts, attachments, or accessories, for use in or on complete refrigeration  equipment, plants, systems, or the "packaged"  refrigeration units, and which are to be classified in class 4130, or as otherwise specifically prescribed by  the indexes and structure of the FSC.', 'Grocery Type Display Cases; Ice Cream Cabinets; Drinking Fountains (except portable and stationary types  classified in class 4510), Professional and Scientific Refrigerators; Rivet Coolers; Photographic Refrigerators; Mortuary Refrigerators; Household and Commercial  Refrigerators; Grocery Type Showcases; and other types of refrigeration equipment of the commissary or food store type.'),
('4120', 'AIR CONDITIONING EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Air Conditioning Equipment', 'Air Conditioning Components (FSC 4130, or as otherwise specifically prescribed by the indexes and structure of the FSC).', 'This class includes only complete air conditioning  equipment, systems, and plants.  Also included are specially designed nonoperating accessories such as a window panel used  with a window type air conditioning unit to facilitate mounting. Excluded from this class are operating components, assemblies, parts, attachments, or accessories for use in or on air  conditioning equipment, which are to be classified in FSC 4130, or as otherwise specifically prescribed by the indexes  and structure of the FSC.', 'Store Type Units; Window and Room Type Units; Marine, and Vehicular Air Conditioning Units; Air Conditioning Plants and Systems.'),
('4130', 'REFRIGERATION AND AIR CONDITIONING COMPONENTS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Refrigeration and Air Conditioning Components', 'Refrigeration and Air Conditioning Plants (see classes 4110 and 4120): Collections of Refrigeration Components "packaged" as a unit including a refrigeration compressor, condenser, evaporator, etc., specifically designed and tailored for applications such as walk-in type refrigerators.  Individual components of the "packaged" unit will be classified in class 4130, or as otherwise specifically prescribed by the indexes and structure of the FSC.  The complete "package" unit will be classified in class 4110.', NULL, 'Heat Exchanger Equipment; Refrigerant Strainers;  Refrigeration Compressors; Air Conditioning and Refrigeration Servicing Equipment, such as Charging and Testing Manifolds, Lines and Units; Operating Components of Refrigeration and Air  Conditioning Equipment, Plants, and Systems classified in classes 4110 and 4120.'),
('4140', 'FANS, AIR CIRCULATORS, AND BLOWER EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Fans, Air Circulators, and Blower Equipment', 'Combination Heater-Fans (see FSC 4520).', 'Fans and impellers which are specifically designed for  use with specific individual types of equipment are to be classified in the same classes as their next higher assemblies  or in the appropriate components or accessories classes (as in group 25 or 29 or class 1680) as prescribed by the indexes and structure of the FSC.', 'Wall Type Fans; Pedestal Type Fans; Household Type and Attic Type Exhaust Fans; Floor Fans; Forced Draft Exhaust and Disposal Kits; Fans; Air Circulators, and Blower Equipment, whether designated as "industrial" or "nonindustrial" by application and/or use.'),
