('43', 'PUMPS AND COMPRESSORS', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group excludes pumps and compressors designed for use on individual types of equipment, such as engine fuel pumps, aircraft propeller feathering pumps, fork lift operating pumps, compressors for  operating gun turrets, and vehicular brake system  compressors.  Also excluded are items specially designed  as or for use on fuel dispensing equipment.  The FSC  indexes and structure will govern the classification of these items permitted classification in a single class  only.', NULL),
