('4470', 'NUCLEAR REACTORS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Nuclear Reactors', NULL, 'This class includes all types of nuclear  reactors and those items which are specifically designed for use within nuclear reactors, their primary cooling  systems, auxiliary fluid systems, special propulsion plant systems, handling and servicing equipment, electrical and control systems, and associated special test and water chemistry control items.  Excluded from  this class are those items for which more specific classifications are suitable.', 'Refueling Machines; Ion Chamber Seals; Thermal Barriers; Control Rods; Steam Generators, Pressurized  Water; Reactor Vessel Shells; Handling Carts, Hoisting  Units, New and Spent Cartridges.'),
