('4820', 'VALVES, NONPOWERED', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Valves, Nonpowered', 'Fire Hydrants (FSC 4210) Sprinkler Heads (FSC 4210), Valves specifically designed for use with fire fighting  equipment (FSC 4210), plumbing equipment and the like (FSC 4540)', NULL, 'Automatic Nonpowered Valves; Gate, Globe, Angle,  Check, and Relief Valves; Cocks.'),
('49', 'MAINT/REPAIR SHOP EQPT', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Specialized equipment which is designed for automotive maintenance and repair and which is also used for the maintenance and repair of nonautomotive vehicles or equipment, will be classified in class 4910.  Jigs, fixtures, and templates used in conjunction with maintenance and repair shop specialized equipment are classified in this group.  However, jigs, fixtures, and templates used in conjunction with metalworking machinery are classified in group 34.  Infrared assemblies, subassemblies, and components specifically designed as test and maintenance specialized equipment are classified in the appropriate classes of this group.  Excluded from this group is infrared equipment designed for testing communications and night vision equipment.', NULL),
('4910', 'MOTOR VEHICLE MAINT EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Motor Vehicle Maintenance and Repair Shop Specialized Equipment', 'Hand Tools (FSG 51), Lubrication and Fuel Dispensing Equipment (FSC 4930), Basic types of electrical and electronic test instruments, including those specifically designed, such as ammeters, voltmeters, ohmmeters, multimeters, and similar instruments as shown in the indexes in the FSC (FSC 6625).', NULL, 'Automotive Lifts; Wheel Aligners; Brake Service Equipment; Tire Maintenance and Repair Equipment; Test stands and test  equipment specially designed for use with motor vehicles.'),
('4920', 'AIRCRAFT MAINTENANCE AND REPAIR SHOP SPECIALIZED EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Aircraft Maintenance and Repair Shop Specialized Equipment', 'Hand Tools; Airfield Maintenance Platforms; Basic types of electrical  and electronic test instruments, including  those specially designed, such as ammeters, voltmeters, ohmmeters, multimeters, and similar instruments, as shown in the indexes to the FSC; Test Apparatus used for both communications and other electrical and electronic equipment.', NULL, 'Maintenance stands designed for support of aircraft assemblies during repair or overhaul; Test Stands and Test Equipment specially designed for maintenance and repair of aircraft components such as: engines, generators, hydraulic systems, armament, automatic pilot, fire control, flight control and navigational systems.'),
('4921', 'TORPEDO MAINT REP & CHECKOUT EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Torpedo Maintenance, Repair, and Checkout  Specialized Equipment', 'Specially designed maintenance test, checkout  and repair shop specialized equipment for maintenance  and repair of ammunition, guided missiles, rockets,  fire control, space vehicles, underwater mines, depth  charges and nuclear ordnance.  Also excludes "basic"  types of electrical and electronic test instruments,  such as ammeters, voltmeters, ohmmeters, multimeters, ngalvanometers and similar instruments.', NULL, 'Specially designed maintenance, test,  checkout, and repair shop specialized equipment for maintenance and repair of torpedoes, torpedo components; adapters, fixtures, inspection and holding fixtures, leveling jack assemblies, fuel filling and syphon  assemblies control surface adapter and protractor assemblies, afterbody cradle adapter and tilting mount assemblies, high pressure air heater assemblies, motor drier and puller assemblies, test stand levels and stands for overhaul, maintenance, test, checkout, and repair of torpedo and torpedo components, test panels, fixtures, and test sets for electrical circuits, firing circuits and torpedo test sets.'),
('4923', 'DEPTH CHARGES AND UNDERWATER MINES MAINTENANCE, REPAIR, AND CHECKOUT SPECIALIZED EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Depth Charges and Underwater Mines Maintenance, Repair, and, Checkout Specialized Equipment', 'Specially designed maintenance, test, checkout, and repair shop equipment designed  for nuclear ordnance, guided missiles, ammunition, torpedoes, rockets, fire control, space vehicles  and "basic" types of electrical and electronic test  instruments.', NULL, 'Specially designed maintenance, test,  checkout and repair shop specialized equipment for  maintenance and repair of depth charges and underwater mines; adapters, inspection, test and holding fixtures; stands for overhaul, maintenance, test, checkout,  and repair of underwater mines and depth charges;  test fixtures, panels plus assemblies and test  sets for leak test, pressure test, firing circuits and timing devices.'),
('4925', 'AMMUNITION MAINTENANCE, REPAIR, AND CHECKOUT SPECIALIZED EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Ammunition Maintenance, Repair, and Checkout Specialized Equipment', 'Maintenance, repair, checkout and test equipment specially designed for use with guided missiles, guided missile remote control systems, guided missile systems; fire control; nuclear ordnance; rockets, underwater mines and depth charges; torpedoes; space vehicles and test equipment for aircraft weapon launchers; basic types of electrical and electronic test instruments, such as ammeters, voltmeters, ohmmeters,  multimeters, and similar instruments as shown in the indexes to the FSC.', NULL, 'Specially designed maintenance, test,  checkout, and repair shop specialized equipment,  for maintenance and repair of ammunition items; adapters; ammunition feeders and hoppers; inspection  and holding fixtures; linkers, linkers-delinkers, and delinkers to assemble and disassemble ammunition belts; surveillance ovens; explosimeters; primer firing device fixtures; mandrels; repositioning machines; gas bomb service kits; test fixtures; panels; plug assemblies; and test sets for ammunition maintenance, checkout, and repair.'),
('4927', 'ROCKET MAINTENANCE, REPAIR AND CHECKOUT SPECIALIZED EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Rocket Maintenance, Repair and Checkout Specialized Equipment', 'Specially designed maintenance, test, checkout, and repair shop equipment specifically designed for nuclear ordnance, guided missiles, fire control, torpedoes, underwater mines, depth charges, ammunition, space vehicles; test equipment for aircraft rocket launchers and "basic" types of electrical and electronic test instruments, such as ammeters, voltmeters, ohmmeters, multimeters, galvanometers and similar instruments.', NULL, 'Specially designed maintenance, test, checkout, and repair shop specialized equipment for maintenance and repair of rockets and rocket components; rocket maintenance stands; test stands; fixtures; jigs; and shop equipment designed for maintenance and repair of rockets, rocket motors and other rocket components.'),
('4930', 'LUBRICATION AND FUEL DISPENSING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Lubrication and Fuel Dispensing Equipment', 'Alemite and Lubrication Fittings (FSC 4730).', NULL, 'Hand Grease Guns; Centralized Lubrication Systems;  Hydrostatic Lubricators; Oil and Gasoline Dispensing Pumps; Fuel Oil Dispensing Pumps; Hand Oilers; Grease Dispensers; Pressure Gun Attachments; Sight  Feed Lubricators.'),
