('4935', 'GUIDED MISSILE MAINTENANCE, REPAIR, AND CHECKOUT SPECIALIZED EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guided Missile Maintenance, Repair, and Checkout Specialized Equipment', 'Specially designed internal (built-in) checkout equipment for  guided missile remote control systems; Basic types of electrical and electronic test instruments, including those specially designed, such as ammeters, voltmeters, ohmmeters, multimeters, and similar instruments, as shown in the indexes to the FSC; Test Apparatus used for both communications and other electrical and electronic equipment.', NULL, 'Checkout equipment and test equipment specially designed  for use with guided missiles and guided missile remote control systems.'),
