('5180', 'SETS KITS & OUTFITS OF HAND TOOLS', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Sets, Kits, and Outfits of Hand Tools', NULL, 'This class includes sets, kits, and outfits consisting of several different item classifiable either in a single class or in several classes.  Excluded from this class are sets, kits, and outfits consisting of variations (such as size or color) of an item. Classify these items in the same class as the individual item.', NULL),
