('58', 'COMM/DETECT/COHERENT RADIATION', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Excludes oscillator items which should be classified in FSC 5955 or 5963; fiber optic items which should be classified in Group 60; electronic  modules as defined under Class 5963; and electrical  cable, cord and wire assemblies, harnesses and sets,   related to FSG 58 equipment (see FSC 5995).  In group  58, more than in any other group, it frequently happens  that the same name is listed as an index entry in each  of several classes.  In addition, that name may also  appear as an entry in groups other than 58.  Each such  entry refers to a distinctly different part or assembly, even though the different items have the same name. The listing of the same name in two or more classes  indicates that, in one form, the part or assembly  covered by the name is applicable to the equipment  covered by one class, and in another form is  applicable to the equipment covered by another  class.  For example, the item name CODER, AUDIO  FREQUENCY is applicable to two distinctly different assemblies, one of which has an application in  cryptologic equipment, covered by class 5810,  and the other in radar equipment covered by class 5840. Consequently the name CODER, AUDIO FREQUENCY is an entry  under each of the two classes.  When an item identification bears a name which  is indexed under more than one class of group 58, or in group 58 and in some other group, the item will be classified in the same class as its next  higher assembly in the manner described in the  Department of Defense, Federal Logistics Information System (FLIS) Procedures Manual, DoD 4100.39-M.  Also excluded from this group are data transmission and communications equipment such as terminals, sensors, and other devices designed for use with a configuration of ADPE.', NULL),
