('5836', 'VIDEO RECORDING AND REPRODUCING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Video Recording and Reproducing Equipment', NULL, 'This class includes, and is restricted to electronic video equipment such as video monitors, televisions, cameras, printers and recorders/ reproducers used with miscellaneous communication equipment.  Also included is associated equipment such as cleaners, splicers, rewinders, reels and tapes designed for use with video recording-reproducing equipment.  Excluded from the class is photographic type equipment (Group 67), ADP type computer monitors (Group 70), and video equipment which includes radio receivers/transmitters (properly classified in more specific classes in Group 58).', NULL),
('5840', 'RADAR EQUIPMENT, EXCEPT AIRBORNE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Radar Equipment, Except Airborne', NULL, 'Radar assemblies and subassemblies designed  specifically for use with fire control equipment  or guided missiles are excluded from this class and are included in the appropriate classes of group 12  or group 14.', NULL),
('5841', 'RADAR EQUIPMENT, AIRBORNE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Radar Equipment, Airborne', NULL, 'Radar assemblies and subassemblies designed  specifically for use with fire control equipment or  guided missiles are excluded from this class and are  included in the appropriate classes of group 12 or  group 14.', NULL),
('5845', 'UNDERWATER SOUND EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Underwater Sound Equipment', NULL, 'This class excludes items specifically designed for fire control sonar systems.', 'Sonar Equipment; Underwater Listening  Equipment; Sonobuoys; Sonobuoy Launchers; Fathometers; Sonar Equipment.'),
('5850', 'VISIBLE AND INVISIBLE LIGHT COMMUNICATION EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Visible and Invisible Light Communication Equipment', NULL, 'This class includes only communication types  of infrared equipment. Excluded from this class are infrared assemblies, subassemblies, and components  designed specifically for use in fire control systems,  guided missile systems, test and maintenance specialized equipment, night vision equipment, and other  noncommunication types of equipment.', 'Heliographs.'),
('5855', 'NIGHT VISION EQUIPMENT, EMITTED AND REFLECTED RADIATION', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Night Vision Equipment, Emitted and Reflected Radiation', 'Optical sighting devices which incorporate both day and night viewing characteristics within an  integral unit for fire control purposes, nonnight vision type items designed for use with guided missiles, communications, or laboratory equipment, and Optical  Elements, such, as Lens, Prisms, Windows.', 'This class includes image forming devices and  associated aids, their subassemblies and components,  utilizing passive and/or active techniques for detection,  observation, and identification of terrain and objects  at night, while maintaining concealment afforded by darkness.  Includes items having multiapplication for purposes of fire control, and/or night observation, and/or detection. Excluded from this class are items for which more specific classifications are suitable as prescribed by the structure and indexes  of the FSC.', 'Sighting and Observation Devices; Target Detectors, Locators, Remote Viewing Systems utilizing heat radiation emitted from object(s), associated Radiation Sources, Image Converters and Image Intensifiers, Optical Cells and other components designed for Night Vision Equipment.  Holders and Lens used with Infrared Equipment are also included in this FSC.'),
('5860', 'STIMULATED COHERENT RADIATION DEV', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Stimulated Coherent Radiation Devices, Components,  and Accessories', NULL, 'This class includes, and is restricted to,  devices the operation of which is based on principles  involving the stimulated emission of radiation, and to associated components and accessories directly related  to stimulated coherent radiation techniques.  The methods  for producing the radiation are those obtained by LASER  (Light Amplification by Stimulated Emission of Radiation) and by MASER (Microwave and/or Molecular Amplification by  Stimulated Emission of Radiation) techniques.  Only those  items specifically designed for stimulated coherent radiation applications, and having no other application, are to be included in this class.  Assemblies or major systems containing such devices are excluded from this  class.', NULL),
('5865', 'ELECTRONIC COUNTERMEASURES, COUNTER-COUNTERMEASURES AND QUICK REACTION CAPABILITY EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Electronic Countermeasures, Counter-Countermeasures and Quick Reaction Capability Equipment', NULL, 'This class includes, and is restricted to, passive and active electronic equipment, systems, and subsystems designed to prevent or reduce an enemy''s effective use of radiated electromagnetic energy or designed to insure our own effective use of radiated electromagnetic energy.', 'Electronic Countermeasures, Electronic Counter-Countermeasures, Electronic Support Measures, and Quick Reaction Capability Equipment and components specially designed therefor which are not classifiable elsewhere in the FSC structure.  Excluded from this class are nonelectronic items which are properly classified in more specific classes in accordance with the FSC structure and indexes.'),
('5895', 'MISC COMMUNICATION EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Miscellaneous Communication Equipment', 'Electronic Countermeasures Equipment.', 'This class includes miscellaneous communication equipment that is not classified in more specific classes. (See the NOTE for FSG 58.)', 'Modems.'),
('59', 'ELECTRICAL/ELECTRONIC EQPT COMPNTS', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Mounting hardware, included in classes of this group, includes such  specially designed items as brackets, holders, retainers, etc.  Excluded from classes  in this group are such hardware items as screws (FSC 5305), bolts (FSC 5306), studs (FSC 5307), washers (FSC 5310), rivets (FSC 5320), and other common items  indexed to specific classes, other than in group 59.  The FSC indexes and structure  will govern the classification of items used on or with mounting hardware cited above.', NULL),
