('5915', 'FILTERS AND NETWORKS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Filters and Networks', NULL, 'This class includes those filters and networks which consist of a  combination of resistors, capacitors, or coils, but not a combination of resistors  only (classified in 5905). capacitors only (classified in 5910), or coils only  (classified in 5950).', NULL),
