('5960', 'ELECTRON TUBES & ASSOC HARDWARE', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Electron Tubes and Associated Hardware', 'Transistors; Tube Sockets; X-ray Tubes; Semiconductor Devices and Associated Hardware.', NULL, 'Rectifying Tubes; Photoelectric Tubes; Electron Vibrator Tubes.'),
('5961', 'SEMICONDUCTOR DEVICES AND ASSOCIATED HARDWARE', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Semiconductor Devices and Associated Hardware', 'Microcircuits; Optoelectronic Devices and Associated Hardware.', NULL, 'Semiconductor Assemblies; Semiconductor Diodes; Semiconductor Rectifiers, Semiconductor Thyristors; Transistors; Unitized Semiconductors; Associated Hardware except Sockets.'),
('5962', 'MICROCIRCUITS, ELECTRONIC', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Microcircuits, Electronic', 'Single Circuit Elements such as Capacitors; Resistors; Diodes and Transistors; Printed Circuit Boards and- Circuit Card Assemblies; and Filters and Networks.', '(1) A microcircuit is defined as follows:  A small circuit having  a high equivalent circuit element density, which is considered as a single part  composed of interconnected elements placed and/or formed on or within a single  substrate to perform an electronic circuit function.  The elements may be  on or within a semiconductor material substrate; may consist of conductive film(s) formed on an insulating substrate; or may be a combination of one or both of these types with discrete elements. (2) The term "microcircuit", as applied to circuit devices included in this class, is delimited to exclude items consisting  solely of interconnected "microcomponents" (discrete miniaturized components).   Also excluded are items fabricated in the form of monolithic thick-film or thin-film structures that in themselves are not functional electronic circuits   (e.g., capacitors, resistors, transistors, or "arrays" thereof).', 'Integrated Circuit Devices; Integrated Circuit Modules; Integrated Electronic Devices: Hybrid, Magnetic, Molecular, Opto-Electronic, and Thin Film.'),
('5963', 'ELECTRONIC MODULES', to_date('03/15/1980', 'MM/DD/YYYY'), NULL, 'Electronic Modules', 'Microcircuits; Electronic Test Equipment Plug-In Units.', 'The term "electronic module" as used in this class designates an electronic component designed for use in various equipment or end item  applications, and capable of controlling voltage and/or current to produce  gain, oscillation, switching or similar integral electronic functions.  It consists of a collection of miniaturized electronic parts and/or elements in a  single replaceable package with plug-in mounting which will also complete the  required electrical connections.  It is not normally subject to disassembly as  distinguished from such items as CIRCUIT CARD ASSEMBLY and  ELECTRONIC COMPONENTS ASSEMBLY.  These modules conform to  industry or government specifications/standards that define all physical  dimensions and electrical parameters required to promote commonality and  ensure proper operational performance.', 'Microcircuits; Electronic Test Equipment Plug-In Units.'),
('5965', 'HEADSETS, HANDSETS, MICROPHONES AND SPEAKERS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Headsets, Handsets, Microphones and Speakers', NULL, NULL, NULL),
