('60', 'FIBER OPTIC', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Fiber Optics is a general term used to describe the function where optical energy (i.e., light/laser driven rays) is guided to another location through fiber(s).  This group includes Fiber Optics items such as parts, materials, and devices used for communications, data transmission, or  illumination.  Excludes Imaging devices under FSG 65 (Medical), hand tools under FSG 51;  Electrical, Electronic and Optical Instruments under FSG 66 (Instruments).', NULL),
