('6015', 'FIBER OPTIC CABLES', to_date('09/15/1980', 'MM/DD/YYYY'), NULL, 'Fiber Optic Cables', NULL, 'Included in this class are one or more discrete fiber optic conductors with  a common protective covering in bulk form.  May include electrical conductors/cables and/or reinforcing material.', NULL),
