('6636', 'ENVIRONMENTAL CHAMBERS & RELATED EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Environmental Chambers and Related Equipment', 'General purpose prefabricated buildings, chambers, panels, and components (FSC 5410), Controlled Environmental Conditioning Kits and Sets (FSC 4240), Baths (FSC 4510),  Ovens (FSC 7310), Kilns (FSC 3630), Radiosonde Baseline Check Sets (FSC 6660), Divers  Recompression Chambers (FSC 4220), Altitude Training Decompression Chambers (FSC 6930), and chambers used as training devices (FSC 6930),  Checkout and Test Equipment (FSC 6625), Chemical Analysis Instruments (FSC 6630), Electrical and Electronic Properties Measuring and Testing Instruments (FSC 6625), Meteorological Instruments (FSC 6660).', 'This class includes only those environmental chambers used exclusively to perform controlled tests, under simulated conditions, to determine physical damage and/or changes in operating characteristics for equipment and components  such as Humidity, Immersion, Moisture; Altitude; Explosion; Thermal Shock;  Sand and Dust; Flammability; Seal.  Environmental chambers included in this  class provide data regarding service life and behavior of various items equivalent  to actual service conditions existing in the field.', 'Chambers; Wind Tunnels; Enclosures specifically designed to simulate an environmental condition; Weather-ometers; Fadeometers; Specially designed equipment and components exclusively related to environmental chambers.'),
