('69', 'TRAINING AIDS AND DEVICES', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Included are computers (including computer assemblies, computer systems and components) designed specifically for use as, or with training aids and devices.', NULL),
