('6920', 'ARMAMENT TRAINING DEVICES', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Armament Training Devices', 'Target Drones; Drones for such use as training, surveillence, missile evaluation, and photographic reconnaissance; Atomic Ordnance Training Devices; Training Aids; Drill, Dummy, Exercise, Practice, or  Simulated Ammunition and Weapons.', NULL, 'Bombing Trainers; Gunnery Trainers; Tow Targets; Gunnery Targets; Guided Missile Training Sets.'),
('6930', 'OPERATION TRAINING DEVICES', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Operation Training Devices', 'Training Aids', NULL, 'Link Trainers; Automatic Pilot Training Devices; Drift Meter Training Devices; Celestial Navigation Trainers; Dead Reckoning  Navigation Trainers; Instrument Flying and Landing Trainers; Terrain Projection Trainers; All operational training devices except  communication and armament.'),
