('70', 'ADP EQPT/SOFTWARE/SUPPLIES AND EQPT', to_date('10/01/1979', 'MM/DD/YYYY'), '09/30/2015', NULL, NULL, NULL, NULL),
('7010', 'ADPE SYSTEM CONFIGURATION', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2015', 'ADPE System Configuration', NULL, 'A group of general purpose analog, digital, or hybrid electronic or electromechanical devices that are interconnected to operate as a system. Frequently referred to as an ADP system, although the term "system" is not considered definitive.', 'an assembly of devices consisting of a central processing unit (CPU) and the necessary input/output devices, accessorial devices, analog  measurement devices, software and/or firmware required to perform the  desired objectives.  Also includes sup-assemblies and units in which  input/output devices, CPUs, and/or accessorial devices or components  are incorporated into a single assembly or unit.  A specially designed  device incorporated into a system shall not influence the classification  of the base assembly or unit.'),
('7020', 'ADP CENTRAL PROCESSING UNIT (CPU, COMPUTER), ANALOG', to_date('10/01/2011', 'MM/DD/YYYY'), '09/30/2015', 'ADP Central Processing Unit (CPU, Computer), Analog', NULL, 'An analog is a representation in one form of a physical condition existing in another form (e.g., the level of mercury in a tube represents temperature in a thermometer; the angular position of a needle represents speed on a speedometer).  This class includes only CPUs that accept as inputs the electrical equivalent of physical conditions such as flow, temperature, pressure, angular position or voltage and perform computations by manipulating these electrical equivalents  to produce results for further use.', NULL),
('7021', 'ADP CENTRAL PROCESSING UNIT (CPU, COMPUTER), DIGITAL', to_date('10/01/2011', 'MM/DD/YYYY'), '09/30/2015', 'ADP Central Processing Unit (CPU, Computer), Digital', NULL, 'Digital refers to the representation of discrete numbers, symbols and alphabetic  characters by a predetermined, coded combination of electrical  impulses. This class includes only CPUs that accept information represented  by digital impulses. Specifically, a device capable of performing sequences of  arithmetic and logic operations (a program) not only on data but also on the program which is contained in its internal memory (storage) without intervention of an operator.', NULL),
('721', 'INFORMATION TECHNOLOGY CENTRAL PROCESSING UNIT (CPU, COMPUTER), DIGITAL', to_date('10/01/2015', 'MM/DD/YYYY'), NULL, 'Information Technology Central Processing Unit (CPU, Computer), Digital', NULL, 'Digital refers to the representation of discrete numbers, symbols and alphabetic  characters by a predetermined, coded combination of electrical  impulses. This class includes only CPUs that accept information represented  by digital impulses. Specifically, a device capable of performing sequences of  arithmetic and logic operations (a program) not only on data but also on the program which is contained in its internal memory (storage) without intervention of an operator.', NULL),
('7022', 'ADP CENTRAL PROCESSING UNIT (CPU, COMPUTER), HYBRID', to_date('10/01/2011', 'MM/DD/YYYY'), '09/30/2015', 'ADP Central Processing Unit (CPU, Computer), Hybrid', NULL, 'Hybrid refers to a combination of analog and digital capability as  defined in classes 7020 and 7021 with conversion capability required for  intercommunication.', NULL),
('7025', 'ADP INPUT/OUTPUT AND STORAGE DEVICES', to_date('10/01/2011', 'MM/DD/YYYY'), '09/30/2015', 'ADP Input/Output and Storage Devices', NULL, 'This class includes devices used to control and transfer information to and from a Computer (as modified).  The input device is used for transferring data and instructions into a computer.  The output device is used to transfer results of processing by the computer to ADP peripheral devices.  Input/output devices combine the above functions in the same device.  This class includes printers, display units, disk drive units (magnetic, optical and floptical), tape drive units, terminals, data entry devices and transfer units.  Also includes Optical Compact Disk (CD) devices used for the storage and retrieval of data and firmware.', NULL),
('7030', 'ADP SOFTWARE', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2015', 'ADP Software', 'operating manuals and programmers manuals properly classified in FSG 76; Excludes software designed to Government specifications to satisfy the requirements of a particular user or for use with ADPE properly classifiable in an FSG other than FSG 70.', 'Software is a series of instructions or statements in a form  acceptable to a CPU, designed to cause the ADPE configuration to  execute an operation or operations; or a collection of data in a form capable of being processed and operated on by a computer.', 'system  programs, such as operating systems, assemblers, compilers, executive routines,  interpreters, translators; utility programs, such as sort/merge programs, media  conversion, maintenance diagnostic programs; and application programs, such as payroll, inventory control, and engineering analysis programs.'),
('7035', 'ADP SUPPORT EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2015', 'ADP Support Equipment', NULL, 'This class includes various devices and associated control  units which are designed for use in combination or conjunction with  an ADPE configuration but are not part of the configuration itself.  ADP support equipment includes magnetic tape testing , certifying,  and cleaning equipment; disk pack testing, certifying and cleaning equipment; tape equipment, rewinders, splicers, and spoolers and card reconditioners.  Included in this class are complete  units and components of related general purpose commercially available support equipment which are not specifically designed for use as part of system  such as a weapon system, control system, digital image processing system,  missile system, communication system or navigation system.  Also included  are support control systems and components not specifically designed for use  with process control such as automatic machine tool processing operations in which flow, pressure, temperature or other parameters are controlled by  instrument regulations in automatic machine tool and process operations.', NULL),
('735', 'INFORMATION TECHNOLOGY SUPPORT EQUIPMENT', to_date('10/01/2015', 'MM/DD/YYYY'), NULL, 'Information Technology Support Equipment', NULL, 'This class includes various devices and associated control  units which are designed for use in combination or conjunction with  an Information Technology (IT) Equipment or Automated Data Processing (ADP)configuration but are not part of the configuration itself.  IT or ADP support equipment includes magnetic tape testing , certifying and cleaning equipment, tape equipment, rewinders, splicers, spoolers, and card reconditioners.  Included in this class are complete units and components of related general purpose commercially available support equipment which are not specifically designed for use as a part of a system such as a weapon sysem, control system, digital image processing system, missile system, communication system or navigation system. Also included are support control systems and components not specifically designed for use with process control such as automatic machine tool processing operations in which flow, pressure, temperture or other parameters are controlled by instrument regulations in automatic machine tool and process. ', NULL),
('7040', 'PUNCHED CARD EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Punched Card Equipment', 'Card actuated machines designed for use with an ADPE system.', NULL, 'Collating machines, key punch machines, tabulating machines; verifiers; reproducers; summary punches, sorters; interpreters.'),
('7042', 'MINI AND MICRO COMPUTER CONTROL DEVICES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Mini and Micro Computer Control Devices', 'Mini and micro computer control devices which are designed  specifically for use in and/or integral to higher order systems, e.g., aircraft  fire control systems, numerically controlled machine tools, sequence  controlled printing equipment, motion measuring instruments, office information system equipment; and the like.', NULL, 'Mini or micro computers used as control mechanisms where  computer technology is essential in controlling, monitoring, measuring,  and directing processes, devices, instruments or other equipment.'),
('7045', 'ADP SUPPLIES', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2015', 'ADP Supplies', NULL, 'This class includes ADP tape seal bands, reels and hubs, carrying cases, canisters, and the like.  Also includes all nonrecorded magnetic recording media deigned to be used with ADP equipment, such as magnetic tape, removable disk packs, magnetic cards, cassettes and diskettes.  Also includes Optical Disks used for the storage of data.', NULL),
('7050', 'ADP COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2015', 'ADP Components', NULL, 'This class includes ADP component assemblies that are parts  of analog, digital or hybrid data processing devices.  Excluded from the class are  items for which more specific classifications are suitable.  The FSC structure  and indexes will govern the classification of those items permitted  classification in a single class only.', NULL),
