('7310', 'FOOD COOKING, BAKING, AND SERVING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Food Cooking, Baking, and Serving Equipment', 'Carts other than Serving; Commissary or Food Store Type Refrigeration Equipment; Commercial Household, or Professional and Scientific Refrigerators; Drinking Fountains; (see class 4110 for items excluded from class 7310).', 'This class includes warming and/ or chilling equipment used for  the display and serving of food.', 'Warming and/or Chilling Tables, Stationary and Portable; Serving  Carts; Field and Mobile Baking Ovens; Toasters; Waffle Irons; Grills;  Special Aircraft, Marine, and Railway Type Food Cooking Equipment;  Utensils with Integral Heating Units; Cafeteria Type Display Cases and Showcases; Soda Fountains; Milk, Soda, and/or Ice Cream Dispensers; Cold Food Counters; Combination Heated-Refrigerated Food Serving Equipment; Carbonators; and other types of refrigerated food serving and display equipment commonly used in cafeterias, mess hall kitchens, and the like.'),
