('7430', 'TYPEWRITERS AND OFFICE TYPE COMPOSING MACHINES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Typewriters and Office Type Composing  Machines', 'Typewriters and office type composing machines which are  designed primarily for use as a component of an ADPE system or that  are user programmable, and that can be applied to a variety of  applications by the internal execution of a series of instructions, not limited to  specific keystroke functions, but controlled by some form of general purpose data processing language.', NULL, 'Typewriters and office type composing machines with built-in electric/electronic functions such as margins, headings, tabs, centering  and related actions.'),
('7435', 'OFFICE INFORMATION SYSTEM EQUIPMENT', to_date('11/15/1981', 'MM/DD/YYYY'), NULL, 'Office Information System Equipment', 'General purpose ADPE which is designed primarily to be applied  through the internal execution of a series of instructions, not limited to  specific keystroke functions, but controlled by a general purpose data processing language, to process a variety of applications such as financial  management, logistics, scientific, communications, and the like.', NULL, 'Minicomputer and microcomputer controlled systems specifically designed for user programmable processing of the office information application; Connected peripheral equipment; Automatic repetitive typewriters;  Text editing typewriters and video display text editing typewriters.'),
